float leaky_relu(float x) {
   if (x > 0) {
       return x;
   }
   return 0.01 * x;
}

float sigmoid(float x) {
    if (x > 10) x = 10;
    if (x < -10) x = -10;
    
    float nexp_x = exp(-x);
    return 1 / (1 + nexp_x);
}

void linear_layer1( const float W[H1][INPUT_SIZE], const float b[H1], const float in[INPUT_SIZE], float out[H1] ) {
    f_int FIUnion;
       for (int o = 0; o < H1; o++) {
            float acc = b[o];
            for (int i = 0; i < INPUT_SIZE; i++) {
                FIUnion.float_version = in[i];
                acc += W[o][i] * FIUnion.int_version;
                //cout << FIUnion.int_version << " ";
            }
            out[o] = acc;
       }
}

void linear_layer2( const float W[H2][H1], const float b[H2], const float in[H1], float out[H2] ) {
       for (int o = 0; o < H2; o++) {
           float acc = b[o];
           for (int i = 0; i < H1; i++) {
               acc += W[o][i] * in[i];
           }
           out[o] = acc;
       }
}

void linear_layer3( const float W[OUTPUT_SIZE][H2], const float b[OUTPUT_SIZE], const float in[H2], float out[OUTPUT_SIZE] ) {
       for (int o = 0; o < OUTPUT_SIZE; o++) {
           float acc = b[o];
           for (int i = 0; i < H2; i++) {
               acc += W[o][i] * in[i];
           }
           out[o] = acc;
       }
}

